import './Form.css'
import {useState} from 'react'
//import {useDispatch} from 'react-redux'


import validation from '../Validation/validation.js'

const Form = ()=>{
    ///const dispatch = useDispatch(); 
    const [errors, setErrors] = useState({});
    const [conname, setConname] =useState(40)
    

    const [userData, setUserData]=useState({
        name:'', 
        description:'', 
        platforms:'', 
        image:'', 
        release_date:'', 
        rating:'', 
        genres:''
    });

    const handlChange = (event) =>{
       
        const { name, value } = event.target;

        if (name === 'name') {
            if (value.length<=40) {
                    setConname(40-value.length); // Actualizar conname con la nueva longitud
                }
        }



        setUserData({
            ...userData,
            [event.target.name]:event.target.value
        })

        setErrors(validation({
            ...userData,
            [event.target.name]:event.target.value
        }))

    }


    const handleGuardar =async (event)=>{

    }


    const handleLimpiar = () => {
        setUserData({
            name: '',
            description: '',
            platforms: '',
            image: '',
            release_date: '',
            rating: '',
            genres: ''
        });
        setErrors({});
    }
    


    return (
    
        <div className="containerCreate">
                <div className="container_titulo"> 
                 <h1> Nuevo Dog</h1>
                </div>
              
                <form  onSubmit={handleGuardar}>
               <div className="contenedor_texto">
             
              
                    Raza: 
                    <input 
                            type="text" 
                            name="name" 
                            value={userData.name}
                            onChange={handlChange}
                            maxLength={40}
                            placeholder="Raza"
                            title='No Puede ser mayor a 40 caracteres'
                            /><label id='name_con'>{conname}</label>
                          
    
                            <br/>
                            <div>
                            {
                                                errors.name && <p className='error'>* {errors.name}</p>
                                            }
                                            </div>
                                            <br/>
                                            height: 
                    <input 
                            type="text" 
                            name="height" 
                            value={userData.name}
                            onChange={handlChange}
                            maxLength={40}
                            placeholder="Raza"
                            title='Detallamos la altura del animal en centimertros'
                            /><label id='Centimetros aproximadamente'>{conname }cm</label>
                          
    
                            <br/>
                            
                            <div>
                            {
                                                errors.name && <p className='error'>* {errors.name}</p>
                                            }
                                            </div>
                                            <br/>

                    weight: 
                    <input 
                            type="text" 
                            name="height" 
                            value={userData.name}
                            onChange={handlChange}
                            maxLength={40}
                            placeholder="Raza"
                            title='No Puede ser mayor a 40 caracteres'
                            /><label id='name_con'>{conname}</label>
                          
    
                            <br/>
                            
                            <div>
                            {
                                                errors.name && <p className='error'>* {errors.name}</p>
                                            }
                                            </div>
                                            <br/>
                                            Life Span: 
                    <input 
                            type="text" 
                            name="height" 
                            value={userData.name}
                            onChange={handlChange}
                            maxLength={40}
                            placeholder="Raza"
                            title='No Puede ser mayor a 40 caracteres'
                            /><label id='name_con'>{conname}</label>
                          
    
                            <br/>
                            
                            <div>
                            {
                                                errors.name && <p className='error'>* {errors.name}</p>
                                            }
                                            </div>
                                            <br/>
    
                Imagen: 
                <input 
                type="text" 
                name="image" 
                value={userData.image}
                onChange={handlChange}
                placeholder="URL de Imagen"
                />
                <br/>
                <div>
                {
                                                errors.image && <p className='error'>* {errors.image}</p>
                                            }
                                            </div>
                </div>
               
               <div className="container_botones">
                <button className="boton_guardar" onClick={handleGuardar}>Enviar</button> 
                <button className="boton_verificar" onClick={handleLimpiar}>Limpiar</button> 
    
               </div>
               </form>
    
        </div>)
    }

export default Form;
